Really excited to go back to my old favorites - and really, really excited to add some new shops and locations to the rotation (Edmonton! Chicago! Seattle!)! Next year will feature less overall travel for me (I’m tired, y’all), and a few extra Alterations-Only weekends, due to student demand (and also due to selfishness, because it’s an amazingly FUN class and I just love teaching it!). Mark your calendars! Tell your friends! Practice your Pony dance!

So grateful for a wonderful 2023, and already can’t wait for 2024! Who’s joining me next year?? Let’s get this party STARTED🕺🏻🪅🩷
